import React from "react";
import "./not-found.scss";

const NotFound = () => (
  <div className="error-page">
    <div className="title animate__animated animate__jackInTheBox">
      <h1>OOPS!!</h1>
      <h1>PAGE WAS NOT FOUND</h1>
    </div>
  </div>
);
export default NotFound;
